  </div>
</template>

<script>
export default {
  name: "MapRenters",
  computed: {
    current() {
      return this.$store.state.localStorage.current;
    },
    tiers() {
      return this.$store.state.localStorage.tiers;
    },
    rooms() {
      return this.$store.state.localStorage.rooms;
    },
    tier1() {
      return this.rooms.filter(room => (room.tier.id === 1));
    },
    tier2() {
      return this.rooms.filter(room => (room.tier.id === 2));
    },
    tier3() {
      return this.rooms.filter(room => (room.tier.id === 3));
    },
    tier4() {
      return this.rooms.filter(room => (room.tier.id === 4));
    },
    tier5() {
      return this.rooms.filter(room => (room.tier.id === 5));
    }
  },
  data() {
    return {
      selected: 0,
    }
  },
  async created() {
    await this.$store.dispatch('localStorage/tiersGet');
    await this.$store.dispatch('localStorage/roomGet');
    this.setTier1();
    this.setTier2();
    this.setTier3();
    this.setTier4();
    this.setTier5();
  },
  methods: {
    modal(event) {
      let d = event.target.getAttribute('d');
      let data  = false;
      Object.keys(this.$refs).forEach(el => {
        if (this.$refs[el].getAttribute('d') === d) {
          let title = el.split('_');
          if (this.$refs[el].style.fill === 'rgb(232, 179, 80)') {
            data  = {
              tier: title[1],
              room: title[3]
            };
          }
        }
      });
      if (data) {
        let text = '';
        if (parseInt(data.tier) === 1) {
          text  = this.tiers[data.tier - 1].title+'\r\nНазвание помещении: '+data.room;
        } else {
          text  = this.tiers[data.tier - 1].title+'\r\nID: '+data.room;
        }
        this.$emit('selectRoom',text);
      }
    },
    setTier1() {
      this.tier1.forEach(item => {
        if (this.$refs['tier_1_room_'+item.title]) {
          if (item.status === 2) {
            this.$refs['tier_1_room_'+item.title].style.fill = '#D9D9D9';
          } else if (item.status === 1) {
            this.$refs['tier_1_room_'+item.title].style.fill = '#E8B350';
          } else {
            this.$refs['tier_1_room_'+item.title].style.fill = '#274985';
          }
        }
      });
    },
    setTier2() {
      this.tier2.forEach(item => {
        if (this.$refs['tier_2_room_'+item.id]) {
          if (item.status === 2) {
            this.$refs['tier_2_room_'+item.id].style.fill = '#D9D9D9';
          } else if (item.status === 1) {
            this.$refs['tier_2_room_'+item.id].style.fill = '#E8B350';
          } else {
            this.$refs['tier_2_room_'+item.id].style.fill = '#274985';
          }
        }
      });
    },
    setTier3() {
      this.tier3.forEach(item => {
        if (this.$refs['tier_3_room_'+item.id]) {
          if (item.status === 2) {
            this.$refs['tier_3_room_'+item.id].style.fill = '#D9D9D9';
          } else if (item.status === 1) {
            this.$refs['tier_3_room_'+item.id].style.fill = '#E8B350';
          } else {
            this.$refs['tier_3_room_'+item.id].style.fill = '#274985';
          }
        }
      });
    },
    setTier4() {
      this.tier4.forEach(item => {
        if (this.$refs['tier_4_room_'+item.id]) {
          if (item.status === 2) {
            this.$refs['tier_4_room_'+item.id].style.fill = '#D9D9D9';
          } else if (item.status === 1) {
            this.$refs['tier_4_room_'+item.id].style.fill = '#E8B350';
          } else {
            this.$refs['tier_4_room_'+item.id].style.fill = '#274985';
          }
        }
      });
    },
    setTier5() {
      this.tier5.forEach(item => {
        if (this.$refs['tier_5_room_'+item.id]) {
          if (item.status === 2) {
            this.$refs['tier_5_room_'+item.id].style.fill = '#D9D9D9';
          } else if (item.status === 1) {
            this.$refs['tier_5_room_'+item.id].style.fill = '#E8B350';
          } else {
            this.$refs['tier_5_room_'+item.id].style.fill = '#274985';
          }
        }
      });
    }
  }
}
</script>

